import * as React from 'react';
import wrapIcon from '../utils/wrapIcon';
const rawSvg = (iconProps) => {
    const { className, primaryFill } = iconProps;
    return React.createElement("svg", { width: 24, height: 24, viewBox: "0 0 24 24", xmlns: "http://www.w3.org/2000/svg", className: className },
        React.createElement("path", { d: "M10.03 4.36A1.5 1.5 0 0112.5 5.5v4l6.03-5.14A1.5 1.5 0 0121 5.51V18.5c0 .88-.7 1.48-1.46 1.5h-.09c-.32 0-.64-.12-.92-.36l-6.03-5.13v3.99a1.5 1.5 0 01-2.47 1.14l-7.41-6.3a1.75 1.75 0 010-2.67l7.41-6.3zm-7.41 6.3l.49.58z", fill: primaryFill }));
};
const Rewind24Filled = wrapIcon(rawSvg({}), 'Rewind24Filled');
export default Rewind24Filled;
